import React, { Component } from 'react';
import '../Assets/Styles/HamurgerMenu.css';

class Navigation extends Component {
  render() {
    return (
      <nav role="navigation">
      <div id="menu-toggle">
        <input type="checkbox" />

        <span></span>
        <span></span>
        <span></span>

        <ul id="menu">
          <a href="#"><li>Hem</li></a>
          <a href="#"><li>Meny</li></a>
          <a href="#"><li>Om oss</li></a>
          <a href="#"><li>Kontakt</li></a>
        </ul>
      </div>
    </nav>

      )
  }
}

export default Navigation;
